CREATE TABLE `sys_phone_infos` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `build_id` int(10) unsigned DEFAULT NULL COMMENT '应用软件ID',
  `vendor` varchar(64) DEFAULT NULL COMMENT '手机品牌',
  `model` varchar(64) DEFAULT NULL COMMENT '手机型号',
  `resolution` varchar(64) DEFAULT NULL COMMENT '屏幕分辨率',
  `platform` varchar(64) DEFAULT NULL COMMENT '手机操作系统',
  `network_type` varchar(16) DEFAULT NULL COMMENT '网络类型',
  `network_desc` varchar(128) DEFAULT NULL COMMENT '网络描述',
  `cpu` varchar(32) DEFAULT NULL COMMENT '手机CPU型号',
  `memory` varchar(16) DEFAULT NULL,
  `is_tf` tinyint(1) DEFAULT NULL COMMENT '暂时不用',
  `is_tts` tinyint(1) DEFAULT NULL COMMENT '暂时不用',
  `is_touchscreen` tinyint(1) DEFAULT NULL,
  `image_url` varchar(255) DEFAULT NULL,
  `download_count` int(11) DEFAULT NULL,
  `brand_id` int(11) DEFAULT NULL,
  `create_update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `key1` (`vendor`,`model`,`resolution`,`platform`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1428 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='可下载手机型号';
